package main

func selectionsort(items [5000]int) [5000]int {
	for i := 0; i < 5000; i++ {
		var min = i
		for j := i; j < 5000; j++ {
			if items[j] < items[min] {
				min = j
			}
		}
		items[i], items[min] = items[min], items[i]
	}
	return items
}

func main() {
	var toSort [5000]int
	for i := 0; i < 5000; i++ {
		if i < 2500 {
			if i%3 == 0 {
				toSort[i] = -(191*i)%5 - i*31/21
			} else {
				toSort[i] = (111*i)%5 + i*51/231
			}
		} else {
			if i%3 == 0 {
				toSort[i] = (191*i)%3 + i*20/13
			} else {
				toSort[i] = -(317*i)%2 - i*31/123
			}
		}
	}
	var sorted = selectionsort(toSort)

	for i := 0; i < 5000; i++ {
		print(sorted[i], ", ")
		if i%50 == 0 {
			println()
		}
	}

}
